import './BackVideo.css'
const BackVideo = () => {
    return (
        <div className="videobackground">
            <video
             src="https://www.tesla.com/sites/default/files/solarroof/v3/hero/DesignHero_desktop.mp4"
            autoplay ></video>
        </div>
      );
}
 
export default BackVideo;
